import './Home.css';
import {SplitType, gsap} from 'gsap';

function Home() {

	const myText = new SplitType('#intro-name')

        gsap.to('.char', {
            y: 0,
            stagger: 0.05,
            delay: 0.2,
            duration: .1
        })


	return (
		<div className='Home'>
			<div id='intro'>
				<div>
					<div id='intro-words'>
						<div id='intro-name'>AASHNA<br></br>VERMA</div>
						<div id='intro-role'>- Software engineering student -</div>
					</div>
					<div className='circle'></div>
				</div>
			</div>
		</div>
	);
}

export default Home;
